@import url("https://fonts.googleapis.com/css?family=Orbitron&display=swap");

body {
  margin: 0;
  font-family: "Orbitron", sans-serif;
}

.welcome {
  padding-bottom: 8%;
  text-align: center;
  position: relative;
  background-color: #131413;
}

/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

/* ---- particles.js container ---- */

#particles-js {
  position: absolute;
  width: 100%;
  height: 100%;
  background-color: black;
  background-repeat: repeat;
  background-size: cover;
  background-position: 50% 50%;
}

/******************/
///////////////////////////////////////////////////////////////////////////////////////////////
/////////////////////////////Button---testing/////////////////////////////////////////////////
.cBreak-button-con {
  padding: 90px;
}
.btn {
  color: #fff;
  cursor: pointer;
  font-size: 16px;
  font-weight: 400;
  line-height: 45px;
  margin: 0;
  //  max-width: 160px;
  position: relative;
  text-decoration: none;
  text-transform: uppercase;

  @media (min-width: 600px) {
    margin: 0;
  }

  &:hover {
    text-decoration: none;
  }
}

/////////////////////////////
//button-5
///////////////////////////
.btn-5 {
  border: 0 solid;
  text-shadow: none;
  transition: all 1250ms cubic-bezier(0.19, 1, 0.22, 1);
}

.btn-5:hover {
  border: 1px solid;
  box-shadow: inset 0 0 20px rgba(255, 255, 255, 0.5),
    0 0 20px rgba(255, 255, 255, 0.2);
  outline-color: rgba(255, 255, 255, 0);
  outline-offset: 15px;
  text-shadow: 1px 1px 2px #427388;
}

//////////////////////////////////////////////////////////////////////////
/////////////////////////////////////////////////////////////////////////

.zoom {
  transform: scale(0.9);
  animation: zoom 10s ease forwards;
}

@keyframes zoom {
  0% {
    transform: scale(0.9);
  }
  100% {
    transform: scale(1);
  }
}
/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

.name {
  color: rgb(159, 229, 37);
  text-align: center;
  font-size: 30px;
  font-family: "Orbitron", sans-serif;
  animation: name 0.2s ease 1.3s forwards;
  opacity: 0;
}

@keyframes name {
  0% {
    opacity: 0;
  }
  50% {
    opacity: 1;
  }
  100% {
    opacity: 1;
  }
}

.name-container {
  animation: name-container 0.2s ease forwards 1s;
  padding: 0px 10px;
  margin-top: 30px;
}

@keyframes name-container {
  0% {
    background-color: rgb(159, 229, 37);
  }
  30% {
    background-color: rgb(159, 229, 37);
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
    transform: skewX(60deg);
  }
  50% {
    background-color: rgba(5, 231, 151, 0);
    box-shadow: 0px 0px 7px 2px rgba(5, 231, 151, 0);
    transform: skewX(0deg);
  }
  70% {
    background-color: rgb(159, 229, 37);
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
  }
  100% {
    background-color: rgba(5, 231, 151, 0);
    box-shadow: 0px 0px 7px 2px rgba(5, 231, 151, 0);
  }
}

/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

.top-animation {
  display: inline-block;
  width: 100%;
}

.top-animation-table {
  margin: 0 auto;
  border-spacing: 10px;
  border-collapse: separate;
  width: 100%;
  max-width: 400px;
}
/***/

.top-animation-table .pixel:nth-child(4) {
  animation-delay: 1.2s;
}

.top-animation-table .pixel:nth-child(5) {
  animation-delay: 1.1s;
}

.top-animation-table .pixel:nth-child(6) {
  animation-delay: 1s;
}

.top-animation-table .pixel:nth-child(7) {
  animation-delay: 0.9s;
}

.top-animation-table .pixel:nth-child(8) {
  animation-delay: 0.8s;
}

.top-animation-table .pixel:nth-child(9) {
  animation-delay: 0.7s;
}

.top-animation-table .pixel:nth-child(10) {
  animation-delay: 0.6s;
}

.top-animation-table .pixel:nth-child(11) {
  animation-delay: 0.5s;
}

/***/

.top-animation-table .pixel:nth-child(12) {
  animation-delay: 1.7s;
}

.top-animation-table .pixel:nth-child(13) {
  animation-delay: 1.6s;
  position: relative;
}

.top-animation-table .pixel:nth-child(13):after {
  content: "";
  position: absolute;
  width: 100%;
  height: 10px;
  top: 18px;
  left: 0px;
  animation: top-animation 1s linear forwards 1.6s;
}

.top-animation-table .pixel:nth-child(3):after {
  content: "";
  position: absolute;
  width: 100%;
  height: 10px;
  top: 18px;
  left: 0px;
  animation: top-animation 1s linear forwards;
}

.top-animation-table .pixel {
  animation: top-animation 1s linear forwards;
}

.top-animation-table .pixel:nth-child(1) {
  animation-delay: 0.2s;
}

.top-animation-table .pixel:nth-child(2) {
  animation-delay: 0.1s;
}

.top-animation-table .pixel:nth-child(14) {
  animation-delay: 1.5s;
}

.pixel {
  width: 7%;
  height: 10px;
}

.top-animation-table .pixel:nth-child(3) {
  position: relative;
}

@keyframes top-animation {
  0% {
    background-color: rgba(5, 231, 151, 0);
  }

  50% {
    background-color: rgb(159, 229, 37);
    box-shadow: 0px 0px 7px 2px rgba(5, 231, 151, 0.2);
  }

  100% {
    background-color: rgba(5, 231, 151, 0);
    box-shadow: 0px 0px 10px 5px rgba(5, 231, 151, 0);
  }
}

@keyframes left-animation {
  0% {
    background-color: rgba(5, 231, 151, 0);
  }

  50% {
    background-color: rgb(159, 229, 37);
    box-shadow: 0px 0px 7px 2px rgba(5, 231, 151, 0.2);
  }

  100% {
    background-color: rgba(5, 231, 151, 0);
    box-shadow: 0px 0px 10px 5px rgba(5, 231, 151, 0);
  }
}

/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

.cBreak-container {
  width: 40%;
  margin: 0 auto;
  display: inline-block;
}

.cBreak-container .cBreak {
  width: 100%;
  animation: flick 1s ease 1s, a 5s linear 1s infinite;
}

.right-animation {
  width: 20vh;
  display: inline-block;
  vertical-align: top;
  right: 0;
  transform: scaleX(-1);
  // margin-top: 10%;
  // margin-bottom: 10%;
}

@keyframes flick {
  0% {
    opacity: 1;
  }
  3% {
    opacity: 0;
    transform: skew(-35deg);
  }
  5% {
    opacity: 1;
    transform: skew(0deg);
  }
  100% {
    opacity: 1;
  }
}

@keyframes a {
  0% {
    opacity: 1;
  }
  1% {
    opacity: 0;
  }
  2% {
    opacity: 1;
  }
  49.5% {
    transform: skewX(0deg);
  }
  50% {
    transform: skewX(50deg);
  }
  50.5% {
    transform: skewX(0deg);
  }
  100% {
    opacity: 1;
    transform: skewX(0deg);
  }
}

/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

.left-animation {
  width: 20vh;
  // margin-top: 20%;
  // margin-bottom: 10%;
  display: inline-block;
  vertical-align: top;
  position: relative;
}

.left-animation-table {
  width: 50%;
  max-width: 100px;
  border-spacing: 10px;
  border-collapse: separate;
}

.left-animation-cont {
  display: inline-block;
  width: 50%;
  margin-right: 10%;
  vertical-align: middle;
}

.left-animation-table .pixel {
  width: 33% !important;
  animation: left-animation 1s linear forwards;
}

.left-animation-table .pixel-container:nth-child(1) .pixel:nth-child(1) {
  animation-delay: 1s;
}

.left-animation-table .pixel-container:nth-child(1) .pixel:nth-child(2) {
  animation-delay: 1.1s;
}

.left-animation-table .pixel-container:nth-child(1) .pixel:nth-child(3) {
  animation-delay: 1.2s;
}

.left-animation-table .pixel-container:nth-child(2) .pixel:nth-child(1) {
  animation-delay: 1.5s;
}

.left-animation-table .pixel-container:nth-child(2) .pixel:nth-child(2) {
  animation-delay: 1.4s;
}

.left-animation-table .pixel-container:nth-child(2) .pixel:nth-child(3) {
  animation-delay: 1.3s;
}

.left-animation-table .pixel-container:nth-child(3) .pixel:nth-child(1) {
  animation-delay: 1s;
}

.left-animation-table .pixel-container:nth-child(3) .pixel:nth-child(2) {
  animation-delay: 1.1s;
}

.left-animation-table .pixel-container:nth-child(3) .pixel:nth-child(3) {
  animation-delay: 1.2s;
}

/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

.hourglass-container {
  display: inline-block;
  width: 50%;
  position: relative;
  vertical-align: middle;
}

.hourglass1 {
  width: 100%;
  stroke-dasharray: 2000;
  stroke-dashoffset: 2000;
  stroke-width: 4;
  animation: dash 1.8s linear forwards 0.5s;
}

.hourglass {
  fill: rgba(0, 0, 0, 0);
  stroke: rgb(159, 229, 37);
  stroke-miterlimit: 10;
}

@keyframes dash {
  10% {
    opacity: 1;
  }
  11% {
    opacity: 0;
  }
  12% {
    opacity: 1;
  }
  30% {
    opacity: 1;
  }
  41% {
    opacity: 0;
    transform: skew(0deg);
  }
  42% {
    opacity: 1;
    transform: skew(10deg);
  }
  43% {
    opacity: 1;
    transform: skew(0deg);
  }
  100% {
    stroke-dashoffset: 0;
    opacity: 0;
  }
}

.hourglass-container:after {
  content: "";
  height: 20px;
  width: 20px;
  border: 2px solid rgb(159, 229, 37);
  margin-left: 10px;
  opacity: 0;
  position: absolute;
  left: -15px;
  top: -5px;
  animation: appear 0.5s ease 1s;
}

@keyframes appear {
  0% {
    opacity: 0;
  }
  50% {
    opacity: 1;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
  }
  100% {
    opacity: 0;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
  }
}

/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

.lines {
  position: absolute;
  height: 50px;
  width: 70px;
  top: 80px;
  left: 100px;
}

.lines .line {
  width: 0px;
  height: 3px;
  background-color: rgb(159, 229, 37);
  margin-bottom: 20px;
  position: relative;
}

.lines .line:nth-child(1) {
  animation: linesAppear 0.7s ease 1.9s;
}

.lines .line:nth-child(2) {
  animation: linesAppear 0.7s ease 2.1s;
}

.lines .line:nth-child(3) {
  animation: linesAppear 0.7s ease 2.3s;
}

@keyframes linesAppear {
  0% {
    width: 0px;
    height: 3px;
    opacity: 0;
  }
  50% {
    width: 100%;
    height: 3px;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
    opacity: 1;
  }

  80% {
    width: 100%;
    height: 3px;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
    opacity: 1;
  }
  100% {
    width: 100%;
    height: 3px;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
    opacity: 0;
  }
}

/**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************
**********************************************************************************************************/

.chain {
  position: absolute;
  left: 50%;
  top: 50%;
  -webkit-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
}

.chain .chain-f {
  border: 3px solid rgb(159, 229, 37);
  height: 50px;
  width: 50px;
  transform: rotate(45deg);
  opacity: 0;
}

.chain .chain-f:nth-child(2) {
  animation: appearShadow 0.5s ease 2.8s forwards;
}
.chain .chain-f:nth-child(1) {
  animation: appearShadow 0.5s ease 3s forwards;
}
.chain .chain-f:nth-child(3) {
  animation: appearShadow 0.5s ease 3.2s forwards;
}

@keyframes appearShadow {
  0% {
    opacity: 0;
  }
  50% {
    opacity: 1;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
  }
  65% {
    opacity: 1;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
  }
  67% {
    opacity: 0;
    box-shadow: 0px 0px 7px 2px rgba(5, 231, 151, 0);
  }
  68% {
    opacity: 1;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
  }
  100% {
    opacity: 1;
    box-shadow: 0px 0px 7px 2px rgb(159, 229, 37);
  }
}

.inside-chain {
  width: 20px;
  height: 20px;
  border-left: 3px solid rgb(159, 229, 37);
  border-top: 3px solid rgb(159, 229, 37);
  border-left: 0;
  border-bottom: 0;
  box-shadow: 0;
  transform: rotate(45deg);
  animation: borders 0.7s ease 3s forwards;
  transform: rotate(0deg) translate(10px, 10px);
}

@keyframes borders {
  0% {
    border-left: 3px solid rgb(159, 229, 37);
    border-top: 3px solid rgb(159, 229, 37);
    border-right: 0;
    border-bottom: 0;
  }
  50% {
    border-left: 0;
    border-top: 3px solid rgb(159, 229, 37);
    border-right: 0;
    border-bottom: 3px solid rgb(159, 229, 37);
  }
  100% {
    border-left: 0;
    border-top: 0;
    border-right: 2px solid rgb(159, 229, 37);
    border-bottom: 2px solid rgb(159, 229, 37);
  }
}

.cBreak-button {
  // position: absolute;
  // top: 70%;
  // left: 50%;
  // height: 10vh;
  // align-content: center;
  // display: inline-block;
  // flex-direction: row;
