  border-radius: 5px;
  position: relative;
  top: 10vh;
  left: 10%;
  width: 400px;
  height: 200px;
  //margin: auto;
  //transform-style: preserve-3d;
  backface-visibility: hidden;
  //display: block;
  box-shadow: 0 0 5px rgb(159, 229, 37);
  //position: relative;
  background-color: transparent;

  &:after {
    content: " ";
    position: absolute;
    width: 100%;
    height: 10px;
    border-radius: 50%;
    left: 0;
    bottom: -50px;
    box-shadow: 0 30px 20px rgb(159, 229, 37);
  }

  .card-content {
    position: relative;
    top: 15%;
    text-align: center;
  }

  p {
    display: block;
  }
  a {
    color: #69c6b8;
    pointer-events: auto;
  }
}

.t-glitch {
  position: relative;
  text-decoration: none;
  color: #fff;
}

.t-glitch:before,
.t-glitch:after {
  content: attr(data-glitch);
  display: block;
  width: 100%;
  position: absolute;
  top: 0;
  left: 0;
  height: 100%;
  opacity: 0.8;
}

.t-glitch:after {
  color: #f0f;
  z-index: -2;
  animation: glitch 0.45s cubic-bezier(0.25, 0.46, 0.45, 0.94) reverse both
    infinite;
}

.t-glitch:before {
  color: #0ff;
  z-index: -1;
  animation: glitch 0.35s cubic-bezier(0.25, 0.46, 0.45, 0.94) both infinite;
}

@keyframes glitch {
  0% {
    transform: translate(0);
  }
  20% {
    transform: translate(1px, 1px);
  }
  40% {
    transform: translate(-4px, 2px);
  }
  60% {
    transform: translate(1px, 3px);
  }
  80% {
    transform: translate(2px, -1px);
  }
  to {
    transform: translate(0);
  }
}

.timeline {
  position: relative;
  overflow: auto;

  &:before {
    content: "";
    position: absolute;
    height: 100%;
    width: 5px;
    background: black;
    left: 0;
  }

  h2 {
    background: black;
    max-width: 6em;
    margin: 0 auto 1em;
    margin-top: 5%;
    padding: 0.5em;
    text-align: center;
    position: relative;
    clear: both;
  }

  ul {
    list-style: none;
    padding: 0 0 0 1em;
    z-index: 1;
  }

  li {
    background: black;
    padding: 1em;
    margin-bottom: 1em;
    position: relative;

    &:before {
      content: "";
      width: 0;
      height: 0;
      border-top: 1em solid black;
      border-left: 1em solid transparent;
      position: absolute;
      left: -1em;
      top: 0;
    }
  }

  h3 {
    margin-top: 0%;
  }

  time {
    font-style: italic;
  }
}

@media screen and (min-width: 40em) {
  .container {
    max-width: 100px;
    margin: 0 auto;
  }

  .timeline {
    &:before {
      left: 50%;
      //margin-top: 50%;
    }

    ul {
      padding-left: 0;
      max-width: 700px;
      margin: 10 auto;
    }

    li {
      animation: border-flicker 2s linear infinite;
      width: 42%;
      left: -25%;
    }

    li:nth-child(even) {
      float: right;
      margin-top: 2em;
    }

    li:nth-child(odd) {
      float: left;

      &:before {
        border-top: 1em solid black;
        border-right: 1em solid transparent;
        right: -1em;
        left: auto;
      }
    }

    li:nth-of-type(2n + 1) {
      clear: both;
    }
  }
}

